import React, { useEffect, useState } from 'react';

const ResultsDashboard = () => {
  const [results, setResults] = useState(null);

  useEffect(() => {
    fetch("http://localhost:8000/api/results/")
      .then(res => res.json())
      .then(data => setResults(data));
  }, []);

  if(!results) return <div>Cargando resultados...</div>;

  return (
    <div className="results-dashboard">
      <h2>Comparación de Resultados</h2>
      {results.comparisons && results.comparisons.map((c,i) => (
        <div key={i}>
          <p><strong>Input:</strong> {c.input}</p>
          <p><strong>RAG:</strong> {c.RAG}</p>
          <p><strong>Fine-Tune:</strong> {c.FineTune}</p>
          <p><strong>Híbrido:</strong> {c.Hybrid}</p>
          <hr />
        </div>
      ))}
      <h3>Métricas</h3>
      <p>BLEU: RAG={results.metrics.BLEU.RAG}, FineTune={results.metrics.BLEU.FineTune}, Hybrid={results.metrics.BLEU.Hybrid}</p>
      <p>Cost Estimate: RAG={results.metrics.CostEstimate.RAG}, FineTune={results.metrics.CostEstimate.FineTune}, Hybrid={results.metrics.CostEstimate.Hybrid}</p>
    </div>
  );
};

export default ResultsDashboard;
